import React from 'react'
import Building from '../assets/images/building.png'
import { useWeb3React } from "@web3-react/core";
import { connectWallet } from "../utils/connectWallet";
import { useDispatch, useSelector } from 'react-redux';

const Nav = (props) => {
    const {
        active,
        activate,
        deactivate
    } = useWeb3React();
    const dispatch = useDispatch();
    const contractSelector  = useSelector((state)=>{
        return state.contractReducer
    })
  return (
    <div>
            <nav className="navbar navbar-light bg-light">
                <a className="navbar-brand" href="#">
                    <img src={Building}  width='30' height='30' className='d-inline-block align-top' />
                    Miami Real Estate
                </a>
                <div className='ml-lg-auto'>
                    {
                        active?
                        <div>
                            <button
                                type="button" className="btn btn-primary"
                                style={{background :"primary ", border:"none"}}
                                onClick={()=>{
                                    connectWallet(deactivate, props.setErrorMessage);
                                }}
                            >
                                Connected
                            </button>
                        </div>
                        :
                        <div>
                            <button type="button" className="btn btn-primary"
                                onClick={()=>{
                                    connectWallet(activate, props.setErrorMessage);
                                    dispatch(contractSelector)
                                }}
                            >
                                Connect Wallet 
                            </button> 
                        </div>    
                    }
                </div>
            </nav>
    </div>
  )
}

export default Nav
